import React, { Component } from 'react';

class Navbar extends Component {
  render() {
    return (
      <div id="navbar" ref={this.props.projects}>
        <h3>Sarah Alt</h3>
        <div className="navbar_sections">
          <p onClick={this.props.jump}>Experiences</p>
          <p onClick={this.props.jump2}>Projects</p>
          <p>Contact</p>
        </div>
      </div>
    );
  }
}

export default Navbar;
